/** @format */

import React from "react";
import {
  TitleBlock,
  Thumbnail,
  TitleBox,
  Description,
  DescBar,
} from "./StyleTitleCard";
import { StarFilled } from "@ant-design/icons";
const TitleCard = () => {
  return (
    <>
      <TitleBlock>
        <Thumbnail />
        <TitleBox>
          <h2>닭치Go</h2>
          <p>
            <StarFilled style={{ color: "#ffeaa7" }} />
            (리뷰개수) · 거리 · 원
          </p>
        </TitleBox>
        <Description>
          <DescBar>
            <h3>배달시간</h3>
            <h3>매장/원산지정보</h3>
          </DescBar>
        </Description>
      </TitleBlock>
    </>
  );
};

export default TitleCard;
